import Alert from '@mui/material/Alert'

function DockerStatus({app}) {

  return (
    <>
      {
        app.State === 'running' ? (
          <Alert elevation={10} severity="success">
            {app.Status}
          </Alert>
        ) : (
        app.State === 'paused' ? (
          <Alert elevation={10} severity="warning">
            {app.Status}
          </Alert>
        ) : (
          <Alert elevation={10} severity="error">
            Not found
          </Alert>
        ))
      }
    </>
  )
}

export default DockerStatus
